import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { Link } from 'react-router-dom';

// import Navbar from './pages/Navbar';
import Home from './pages/Home';
import AboutUs from './pages/AboutUs';

import InputTodoItem from "./InputTodoItem"
import DisplayTodoList from "./DisplayTodoList"
import OpenAIRequest from './OpenAIRequest';

import "./App.css";

function App() {
    return (
      <BrowserRouter>
        <Nav defaultActiveKey="/home" as="ul">
          <Nav.Item as="li">
            <Link to="/home" className="nav-link">Home</Link>
          </Nav.Item>
          <Nav.Item as="li">
            <Link to="/link-1" className="nav-link">Link</Link>
          </Nav.Item>
          <Nav.Item as="li">
            <Link to="/link-2" className="nav-link">Link</Link>
          </Nav.Item>
          {/* Continue adding Nav.Item and Link components for additional navigation links */}
        </Nav>
        
        {/* Define your Routes here. They will render the corresponding component when the URL matches. */}
        <Routes>
          <Route path="./pages/home" element={<Home />} />
          {/* ...other Routes */}
        </Routes>
      </BrowserRouter>
    );
  }

export default App;
